import './App.css';

function App() {

  function checkTextHandler(e) {
    e.preventDefault();

    const currentText = document.getElementById("inputText").value;
    console.log(currentText);
  }

  return (
    <div className="App">
      <div className="document">
        <textarea id="inputText" className="inputText"/>
        <button onClick={checkTextHandler}>Check Text</button>
      </div>
    </div>
  );
}

export default App;
